export const ACTIONS = [
  { property: 'flex-direction', options: ['row', 'row-reverse', 'column', 'column-reverse'] },
  { property: 'align-items1', options: ['left', 'right'] },
  { property: 'align-items2', options: ['left', 'right', 'mid'] },
];
